import React from "react";

const WeatherIcon = props => {
  return;
  <>
    {props.icon}

    {(props.icon.props.value === "clear") &
    (props.condition.toLowerCase() === "clear") ? (
      <input type="checkbox" checked />
    ) : (
      <input type="checkbox" />
    )}

    {(props.icon.props.description === "few clouds" ||
      "scattered clouds" ||
      "broken clouds") &
    (props.condition === "partly cloudy") ? (
      <input type="checkbox" checked />
    ) : (
      <input type="checkbox" />
    )}
  </>;
};

export default WeatherIcon;
